import React from 'react';

function About() {
  return (
    <section className="about" id="about">
      <h2>About IHM Sumerpur</h2>
      <p>State Institute of Hotel Management, Sumerpur is dedicated to excellence in hospitality education...</p>
    </section>
  );
}

export default About;
